<html>
  <head>
    <script type="text/javascript" src="https://www.gstatic.com/charts/loader.js"></script>
    <script type="text/javascript">
        var data = {{ list|safe }};
        console.log(data)

        var year = [];
        var in_count = [];
        var out_count = [];
        var in_open = [];
        var month = [];

        for (var i=1; i < data.length; i++) {
            {#console.log(data[i][0]);#}
            in_count.push(data[i][0]);
            out_count.push(data[i][1]);
            in_open.push(data[i][2]);
            month.push(data[i][3]);
            year.push(data[i][4]);
        }

        console.log(in_count)
        console.log(out_count)
        console.log(in_open)
        console.log(month)
        console.log(year)



    </script>
  </head>
  <body>
    <div id="columnchart_material" style="width: 800px; height: 300px;"></div><br>
    <div id="columnchart_material2" style="width: 800px; height: 300px;"></div><br>
    <div id="table_div" style="width: 100%; height: 100%;"></div><br>
    <div id="map_div" style="width: 800px; height: 300px;"></div>
  </body>
</html>
